import React from "react";
import "./css/portfolio.css";
class Portfolio extends React.Component {
  state = {};
  render() {
    return (
      <div className="portfolio" id="Portfolio">
        <div className="head">
          <h1>My</h1>
          <h1></h1>
        </div>
      </div>
    );
  }
}

export default Portfolio;
